#define E820_STORAGE_PHYS   ((uintptr_t)0x00008000)
#define E820_MAX_ENTRIES    64
#define E820_ENTRY_SIZE     24

typedef struct
{
    uint64_t base;
    uint64_t length;
    uint32_t type;
    uint32_t attr;
} __attribute__((packed)) e820_entry_t;

typedef struct
{
    char vendor[13];
    char brand[49];
    uint32_t base_mhz;
    uint32_t max_mhz;
    uint32_t bus_mhz;
} cpu_info_t;

static e820_entry_t g_e820[E820_MAX_ENTRIES];
static uint32_t g_e820_count = 0;
static cpu_info_t g_cpu_info;

static void cpuid(uint32_t leaf, uint32_t subleaf, uint32_t *eax, uint32_t *ebx, uint32_t *ecx, uint32_t *edx)
{
    uint32_t a = 0, b = 0, c = 0, d = 0;
    __asm__ volatile ("cpuid"
                      : "=a"(a), "=b"(b), "=c"(c), "=d"(d)
                      : "a"(leaf), "c"(subleaf));
    if (eax) { *eax = a; }
    if (ebx) { *ebx = b; }
    if (ecx) { *ecx = c; }
    if (edx) { *edx = d; }
}

static void log_dual(const char *text)
{
    if (!text)
    {
        return;
    }
    console_write(text);
    serial_write_string(text);
}

static void log_dual_line(const char *text)
{
    log_dual(text);
    console_putc('\n');
    serial_write_string("\r\n");
}

static void append_text(char *buffer, size_t *index, size_t capacity, const char *text)
{
    if (!buffer || !index || capacity == 0 || !text)
    {
        return;
    }
    while (*text && *index + 1 < capacity)
    {
        buffer[*index] = *text++;
        (*index)++;
    }
    buffer[*index] = '\0';
}

static void append_char(char *buffer, size_t *index, size_t capacity, char c)
{
    if (!buffer || !index || capacity == 0)
    {
        return;
    }
    if (*index + 1 < capacity)
    {
        buffer[*index] = c;
        (*index)++;
        buffer[*index] = '\0';
    }
}

static void append_decimal(char *buffer, size_t *index, size_t capacity, uint64_t value)
{
    if (!buffer || !index || capacity == 0)
    {
        return;
    }
    char tmp[32];
    size_t pos = 0;
    if (value == 0)
    {
        tmp[pos++] = '0';
    }
    else
    {
        while (value > 0 && pos < sizeof(tmp))
        {
            tmp[pos++] = (char)('0' + (value % 10));
            value /= 10;
        }
    }
    while (pos > 0 && *index + 1 < capacity)
    {
        buffer[*index] = tmp[--pos];
        (*index)++;
    }
    buffer[*index] = '\0';
}

static void append_hex(char *buffer, size_t *index, size_t capacity, uint64_t value, uint8_t digits)
{
    if (!buffer || !index || capacity == 0)
    {
        return;
    }
    static const char hex[] = "0123456789ABCDEF";
    for (int i = digits - 1; i >= 0; --i)
    {
        if (*index + 1 >= capacity)
        {
            break;
        }
        uint64_t shift = (uint64_t)i * 4;
        uint8_t nibble = (uint8_t)((value >> shift) & 0xF);
        buffer[*index] = hex[nibble];
        (*index)++;
    }
    buffer[*index] = '\0';
}

static void load_e820(void)
{
    volatile uint16_t *count_ptr = (volatile uint16_t *)E820_STORAGE_PHYS;
    uint32_t count = (uint32_t)(*count_ptr);
    if (count > E820_MAX_ENTRIES)
    {
        count = E820_MAX_ENTRIES;
    }
    volatile const uint8_t *entry_bytes = (volatile const uint8_t *)(E820_STORAGE_PHYS + 4);
    for (uint32_t i = 0; i < count; ++i)
    {
        volatile const e820_entry_t *src = (volatile const e820_entry_t *)(entry_bytes + (i * E820_ENTRY_SIZE));
        g_e820[i].base = src->base;
        g_e820[i].length = src->length;
        g_e820[i].type = src->type;
        g_e820[i].attr = src->attr;
    }
    g_e820_count = count;
}

