    mouse_wait(0);
    uint8_t status = inb(KBD_DATA);
    status |= 0x03;            /* enable both port IRQs */
    status &= ~(1 << 4);       /* ensure first port clock enabled */
    status &= ~(1 << 5);       /* ensure second port clock enabled */
